import React from "react";
import "./Navbar.css";

const Navbar = () => (
    <nav className="navbar z-depth-3">
      <ul>
      <li><a href="/">Welcome</a></li>
      <li><div> value={props.currentScore}</div></li>
      </ul>
    </nav>
  );


  export default Navbar;
